DROP TABLE IF EXISTS laravel.ratings;

CREATE TABLE laravel.ratings (
    id int NOT NULL,
    value int DEFAULT NULL,
    product_id int DEFAULT NULL,
    user_id int DEFAULT NULL,
    created_at datetime DEFAULT NULL,
    updated_at datetime DEFAULT NULL,
    CONSTRAINT pk_rating PRIMARY KEY (id),

    CONSTRAINT fk_lr_product FOREIGN KEY (product_id) REFERENCES laravel.products (id),
    CONSTRAINT fk_lr_user FOREIGN KEY (user_id) REFERENCES laravel.users (id)
);


